import { useEffect, useState } from "react";
import api from "../api"

type Props = {
  categoryName: string;
};
export interface Question {
  id: string;
  name: string;
  description?: any;
  createdAt: Date;
  updatedAt: Date;
  categoryId: string;
}

export interface QuestionObject {
  name: string;
  questions: Question[];
  resposta: number;
}

export const MapQuestions =(categoryName:Props) => {
  const [questions, setQuestions] = useState<QuestionObject[]>();


  useEffect(() => {
    async function getCateriesWithQuestions() {
      const { data } = await api.get<QuestionObject[]>(
        `question?_category.name=${categoryName}`
      );
      setQuestions(data);
    }
    getCateriesWithQuestions();
    console.log(questions);
  }, []);

return (
    <div>
      {questions?.map((question, index) => {
        return (
        <div key={Math.random() + index * 2}>
              <label id="demo-row-radio-buttons-group-label">
                {question.name}
              </label>
                <input type='radio' value="1" name="Category1">1</input>
                <input type='radio' value="2" name="Category1">2</input>
                <input type='radio' value="3" name="Category1">3</input>
                <input type='radio' value="4" name="Category1">4</input>
                <input type='radio' value="5" name= "Category1">5</input>
          </div>
        );
      })}
    </div>
  );


}
